        "vaeua-gui-eua.yAxisTickValueFitPolicy.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.useEntityExtraction.help.tip.txt": "このオプションの詳細情報 ",
