        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.graph.dataLabelThinPolicy.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.control.initialValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">コントロールの初期(デフォルト)値を指定します。初期値は、ユーザーが初めてレポートを開いたとき、またはユーザーが<span class\\="xis-windowItem">デフォルトのレポート状態を復元</span>を選択したときに選択されます。 </p><div class\\="xis-paragraph">テキストフィールドに値を入力するか、次のいずれかを指定します。 <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">自動</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">レポートを保存するときに、選択内容が初期値として保存されることを指定します。 </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">第 1</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> コントロールの最初の値が初期値であることを指定します。</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">parameter-name</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">選択したパラメーターの値がコントロールの初期値であることを指定します。</p><p class\\="xis-paraSimple">適切なデータの種類のパラメーターがすでに存在する場合にのみ、パラメーターを選択できます。</p></dd></dl></div>                 </div><p class\\="xis-paragraph">初期値がデータクエリになく(フィルターなどの理由で)、コントロールが必要ない場合、コントロールには初期値がありません。コントロールが必要な場合は、最初の値が初期値として選択されます。</p></section>',
