        "vaeua-gui-eua.sas.van.pageVisibility.hideLinks.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.termWeight.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.barLabelFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph"><span class\\="xis-windowItem">オーバーラップハンドリング</span>オプションは、棒のラベルを表示する十分なスペースがなく棒のラベルが重なり合う場合に、棒のラベルを表示するために使用するアクションを示します。</p><div class\\="xis-paragraph">                      <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">自動</span></td><td>自動的にラベルを調整します。</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">なし</span></td><td>オーバーラップハンドリングは実行されません。</td></tr></table></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomCategoryEntries.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">カスタムカテゴリ数を減らして、次の問題を解消します。たとえば、優先度(低)の問題を解消するには、レポートのカスタムカテゴリ数を25個以下に減らします。</p><p class\\="xis-paragraph">優先度(低)\\: 25個より多い(&gt; 25)カスタムカテゴリを含む</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.useEntityExtraction.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">エンティティエクストラクタでエンティティの標準リストを使用するかを決定します。</p></section>',
        "vaeua-gui-eua.Properties.svm.rbfParameter.help.tip.txt": "このオプションの詳細情報 ",
