        "vaeua-gui-eua.ModelComparisonBasePropertiesView.predictionCutoff.field.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">オブザベーションがモデル化されたイベントかを決定する予測確率カットオフを指定します。</p></section>',
