        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.useEntityExtraction.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.partialdependence.numObs.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">部分従属プロットに表示されるモデル予測の生成に使用される入力データからサンプリングするオブザベーションの最大数を指定します。</p></section>',
        "vaeua-gui-eua.react.va.geo.search.includeTraffic.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.factMac.nonnegativeFactorization.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.recommendationsPlot.predictor.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.Options.alternativeText.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">オブジェクトにわかりやすい、アクセシブルな名前を指定します。テキストは、ユーザーがオブジェクトに移動したときにスクリーンリーダーによってアナウンスされます。</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.predictorBins.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.neuralnetwork.allowNeuronDirectConnect.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ネットワークの入力ニューロンと出力ニューロン間の直接接続が含まれます。</p></section>',
        "vaeua-gui-eua.properties.sankey.compress.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.factmac.learnStep.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.discreteTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph"><span class\\="xis-windowItem">目盛値の表示</span>オプションは、X軸の目盛値を調整するために使用する方法を示します。<span class\\="xis-windowItem">重複を自動で削減</span>または<span class\\="xis-windowItem">固定された向き</span>のいずれかを選択できます。</p><div class\\="xis-paragraph"><span class\\="xis-windowItem">重複を自動で削減</span>オプションは、目盛値が重なり合っている場合にのみ適用されます。次を指定できます。 <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">互い違い、切り捨て、ドロップ</span></td><td>値を交互に上下にシフトし、目盛値から文字を切り抜き、目盛値を削除します。</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">45 度回転</span></td><td>すべての目盛値を斜めに45度回転します。</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">ずらして表示</span></td><td>目盛値を上下に交互にシフトします。</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">互い違い、切り捨て</span></td><td>目盛値を交互に上下にシフトし、目盛値から文字を切り抜きます。</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">切り捨て</span></td><td>目盛値から文字を切り抜きます。</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">切り捨て、45 度回転</span></td><td>目盛値から文字を切り抜き、すべての目盛値を斜め45度回転させます。</td></tr></table></div>                 </div><div class\\="xis-paragraph"><span class\\="xis-windowItem">固定された向き</span>オプションは常に適用され、値の向きを設定します。次を指定できます。 <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">横</span></td><td>目盛値を横に表示します。</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">45 度回転</span></td><td>すべての目盛値を斜めに45度回転します。</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">45 度回転、ドロップ</span></td><td>すべての目盛値を斜めに45度回転し、目盛値を削除します。</td></tr></table></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.identifyTermRoles.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.linearRegression.significanceLevel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">高速減少選択を実行し、どの変数をモデル作成に考慮するかを決定します。指定有意水準を下回る<span class\\="xis-userSuppliedValue">p</span>値を持つ変数のみが考慮されます。</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.SlowReportLoad.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">レポートの最初のページをロードするために、時間がかかります。SAS Visual Analyticsでロード時間が遅い以外のパフォーマンスの問題を特定した場合、それらの問題を最初に修正します。他のパフォーマンスの問題が特定されない場合は、管理者に連絡して、他の要因がレポートに影響していないかを特定する必要があります。たとえば、低速な接続では、レポートのロードが遅くなることがあります。</p><p class\\="xis-paragraph">優先度(低)\\: 5秒以上(&gt;\\= 5)かかる</p><p class\\="xis-paragraph">優先度(中)\\: 10秒以上(&gt;\\= 10)かかる</p><p class\\="xis-paragraph">優先度(高)\\: 25秒以上(&gt;\\= 25)かかる</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.highCardinalityPredictors.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.neuralnetwork.activationlabel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">正規分布を使用して応答をモデル化する際に出力層を作成するために使用される活性化関数を指定します。指数活性化関数はガンマまたはPoisson分布で使用されます。 </p></section>',
        "vaeua-gui-eua.va.saveToObjectsPaneWithData.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">保存されたオブジェクトに関連するデータアイテム(役割の割り当て、フィルターなど)を含めます。</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.heatmap.binCountNotApplicableToNonMeasures.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
