        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruningRegTree.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">回帰ツリーの剪定に使用されるコスト複雑性測度のアルファ値を指定します。アルファ値が大きいほどツリーは小さくなります。</p></section>',
        "vaeua-gui-eua.usingTimeZones.help.tip.txt": "複数の日付に選択できるタイムゾーンについて",
        "vaeua-gui-eua.sas.van.pageVisibility.hideLinks.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">このページを表示できないユーザーに対してこのページへのテキストリンクを非表示にするかどうかを指定します。 </p><p class\\="xis-paragraph">このオプションを有効にしないと、アクセス権のないユーザーがテキストリンクを開こうとしたときに通知メッセージが表示されます。</p></section>',
        "vaeua-gui-eua.ModelComparisonBasePropertiesView.percentile.field.label.help.tip.txt": "このオプションの詳細情報 ",
