        "vaeua-gui-eua.sas.van.ReportReview.NestedContainers.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.useStopList.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">停止リストを使用するかを決定します。停止リストは、テキストから削除する低品質な情報や無関係の単語の単純なコレクションです。それらの単語は、CAS ServerでロードされるSASデータセットに保存しておく必要があります。</p></section>',
        "vaeua-gui-eua.Properties.logisticRegression.gradientConversion.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.neuralnetwork.annealingRate.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
