        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.includeMissing.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.usedefaultvariable.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">分割ごとの試行に、デフォルトの予測子の数が使用されます。デフォルトは、予測子の総数です。選択しない場合は、分割ごとに試行する予測子の数を指定します。</p></section>',
        "vaeua-gui-eua.Properties.svm.defaultpenalty.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">デフォルトのペナルティ値が使用されます。デフォルトは、1.0です。</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighPageCount.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.missingAssignment.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">候補予測子に欠損値があるオブザベーションの数が、指定された最小値以上の場合、欠損値は、分岐候補の検索の際に、個別の値として処理されます。</p></section>',
        "vaeua-gui-eua.barSpacing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph"><span class\\="xis-windowItem">スペーシング</span>オプションは、棒の間のスペースを指定します。</p><p class\\="xis-paragraph">棒がグループ化されてクラスター化される場合、クラスター間にスペースが表示されます。クラスター内の個々の棒の間にスペースはありません。</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomCategoryEntries.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
