        "vaeua-gui-eua.sas.van.ReportReview.HighCustomSortEntries.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">カスタムソートの値の数を減らして、次の問題を解消します。たとえば、優先度(低)の問題を解消するには、カスタムソートの選択した値の数を25個以下に減らします。</p><p class\\="xis-paragraph">優先度(低)\\: 25個より多い(&gt; 25)ソート数が含まれている</p></section>',
