        "vaeua-gui-eua.Properties.predAuto.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">分析を拡張して欠損値のあるオブザベーションを含めます。カテゴリ因子では、欠損値は分析の実行時に固有の水準として扱われます。メジャー因子では、欠損値は分割ルールの価値の計算に使用されます。分割の価値を最大化する枝に欠損値を割り当てる分割ルールが作成されます。</p></section>',
