        "vaeua-gui-eua.sas.van.ReportReview.HighDataObjectCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">オブジェクト数を減らして、次の問題を解消します。たとえば、優先度(中)の問題を解決するには、レポートのオブジェクト数を12個以下に減らします。</p><p class\\="xis-paragraph">優先度(低)\\: ページに7個より多い(&gt; 7)オブジェクトを含む</p><p class\\="xis-paragraph">優先度(中)\\: ページに12個より多い(&gt; 12)オブジェクトを含む</p></section>',
