        "vaeua-gui-eua.sas.van.control.initialValueSVS.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">コントロールの初期(デフォルト)値を指定します。初期値は、ユーザーが初めてレポートを開いたとき、またはユーザーが<span class\\="xis-windowItem">デフォルトのレポート状態を復元</span>を選択したときに選択されます。 </p><div class\\="xis-paragraph">テキストフィールドに値を入力するか、次のいずれかを指定します。 <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">自動</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">レポートを保存するときに、選択内容が初期値として保存されることを指定します。 </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">最小値</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> コントロールの最小値が初期値であることを指定します。</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">最大値</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> コントロールの最大値が初期値であることを指定します。</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">parameter-name</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">選択したパラメーターの値がコントロールの初期値であることを指定します。</p><p class\\="xis-paraSimple">適切なデータの種類のパラメーターがすでに存在する場合にのみ、パラメーターを選択できます。</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ReportReview.SlowReportLoad.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.includeMissing.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruneWithValidationData.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.connectOrder.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph"><span class\\="xis-windowItem">接続順</span>オプションは、データポイントを結びプロットラインを形成する方法を示します。 <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">軸</span></td><td>X軸に左から右に配置されている順序でデータポイントを結びます。</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">データ</span></td><td>X役割から読み込まれる順序でデータポイントを結びます。</td></tr></table></div>                 </div><p class\\="xis-paragraph">この値を使用すると、入力データがX役割に基づき並べ替えられていない場合に、順序に従って結ばれるようになります。</p></section>',
        "vaeua-gui-eua.Properties.svm.maxSupportVectors.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">サポートベクターの最大数を指定します。アクティブセット法の性質上、実際のサポートベクター数は指定した数よりわずかに多くなる可能性があります。</p></section>',
