        "vaeua-gui-eua.yAxisTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph"><span class\\="xis-windowItem">目盛値の表示</span>オプションは、Y軸の目盛値を調整するために使用する方法を示します。次を指定できます。 <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">いくつかをドロップ</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">一部の目盛値を削除します。</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">すべて表示</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">すべての目盛値を表示します。</p></dd></dl></div>                 </div></section>',
