        "vaeua-gui-eua.sas.van.control.initialMinValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">コントロールの初期最小値(下限)を指定します。初期値は、ユーザーが初めてレポートを開いたとき、またはユーザーが<span class\\="xis-windowItem">デフォルトのレポート状態を復元</span>を選択したときに選択されます。 </p><div class\\="xis-paragraph">テキストフィールドに値を入力するか、次のいずれかを指定します。 <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">自動</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">レポートを保存するときに、選択内容が初期値として保存されることを指定します。 </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">最小値</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> コントロールの最小値が初期値であることを指定します。</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">parameter-name</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">選択したパラメーターの値がコントロールの初期値であることを指定します。</p><p class\\="xis-paraSimple">適切なデータの種類のパラメーターがすでに存在する場合にのみ、パラメーターを選択できます。</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.analyzeSentiment.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ポジティブ語とネガティブ語の使用に基づき、各ドキュメントのセンチメントを分析します。</p></section>',
