        "vaeua-gui-eua.react.va.geo.search.exitSelectionMode.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">選択モードを終了すると、マップをクリックして場所を選択できなくなります。選択モードをもう一度有効にするには、空の<span class\\="xis-windowItem">場所</span>フィールドを選択します。</p></section>',
