        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruning.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">C4.5アルゴリズムに基づいてツリーの剪定アルゴリズムの積極性を指定します。アルゴリズムが積極的になるほどツリーは小さくなります。</p></section>',
