        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.table.detailData.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">データを集計しないことを指定します。</p><p class\\="xis-paragraph">このオプションは集計データを使用する場合に使用でき、ランクと集計後の両方のフィルターに適用されます。リスト表にすでに集計フィルターがある場合や<span class\\="xis-windowItem">他のすべて</span>オプションが指定されたランクがある場合は、このオプションは使用できません。</p><p class\\="xis-paragraph">詳細データを示すリスト表はアクションまたはリンクのソースにできません。</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.vote.help.tip.txt": "このオプションの詳細情報 ",
