        "vaeua-gui-eua.Properties.predAuto.includeMissing.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.cutoffPlot.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">カットオフプロットは、予測カットオフ値が調整されるにつれて、さまざまなモデルアセスメント統計量がどのように変化するかを示しています。これらの統計量は、モデルに選択されたイベントと非イベントの比較に基づいています。 <div class\\="xis-listUnordered"><ul><li class\\="xis-item">カットオフオプションが<span class\\="xis-windowItem">最適カットオフ</span>に設定されている場合、カットオフ線は最適カットオフ値で表示されます。</li><li class\\="xis-item">カットオフオプションが<span class\\="xis-windowItem">固定カットオフ</span>に設定されている場合、カットオフ線をインタラクティブに移動して、異なる予測カットオフ値を表すことができます。</li></ul></div>                 </div><p class\\="xis-paragraph">カットオフ値を調整すると、それに応じてモデルアセスメント統計量が更新されます。この機能を使用すると、特定の問題とビジネス目的に最も適したットオフ値を選択できます。</p><p class\\="xis-paragraph">正解率統計量が有効になっている場合、選択したカットオフに対する値が常に表示されます。</p></section>',
        "vaeua-gui-eua.Properties.tweedie.powerSpecification.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Tweedie累乗パラメーターの決定方法を指定します。</p></section>',
        "vaeua-gui-eua.sas.van.Options.capabilityLevel.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.ReportReview.LowPercentageUsedColumns.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">レポートのデータソースで使用していない列を削除して、次の問題を解消します。たとえば、優先度(低)の問題を解決するには、レポートがデータソースの列の10%以上を使用している必要があります。</p><p class\\="xis-paragraph">優先度(低)\\: データソースの列が100列以上の場合、10%以下(&lt;\\= 10%)の列を使用している</p></section>',
        "vaeua-gui-eua.sas.van.Properties.object.title.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">このオプションは、キー値などの一部のオブジェクトには適用されない場合があります。</p></section>',
        "vaeua-gui-eua.Properties.factmac.learnStep.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">SGDアルゴリズムの学習ステップサイズを指定します。緩慢な学習は、モデルのオーバーフィットを防ぎます。学習ステップ値は、最適化アルゴリズムが効率的に収束するように調整される場合があります。</p></section>',
        "vaeua-gui-eua.Properties.predAuto.numGroups.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.svm.customPenaltyValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">使用するペナルティ値を指定します。通常、ペナルティ値が大きいほど、サポートベクターが少なくなります。</p></section>',
        "vaeua-gui-eua.Properties.assessment.numberOfBins.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.neuralnetwork.learningRate.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.maxNodeCount.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.bayesNet.treeAugmentedNaive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">応答変数からそれぞれの予測子への直接リンクと予測子間のツリー構造を含む、ツリー拡張されたナイーブベイジアンネットワークの作成を試行します。ツリー拡張されたナイーブベイジアンネットワークでは、親の最大数は常に2の必要があります。</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighPageHeaderObjectCount.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.maxNodeCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ネットワークレイアウトの詳細度を指定します。</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.parentChild.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ナイーブベイジアンネットワークを拡張する親-子ベイジアンネットワークの作成を試行します。この拡張により、予測子は応答変数の親、応答変数の親と子の間のリンク、応答変数の子の間のリンクになります。</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.factMac.nonnegativeFactorization.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.ReportReview.HighReportHeaderObjectCount.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.geo.cluster.color.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.svm.customToleranceValue.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.ModelComparisonBasePropertiesView.percentile.field.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">特定の統計量の計算に使用する百分位ビンの深さを指定します。これらの統計量には、イベントの観測平均、リフト、累積リフト、捕捉された累積パーセント、累積パーセントなどが含まれます。</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.linkType.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ノード間のリンクを有向(一方向)にするか、無向(双方向)にするかを指定します。リンクの種類は、ネットワークメトリックの計算に影響します。リンクの矢印が表示されている場合、リンクの種類によってリンクの矢印の方向が決まります。</p></section>',
