        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.pcPlot.maxPolylines.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">平行座標アルゴリズムにより生成される最大折れ線数を指定します。この値を大きくすると、より詳細なビン化が可能になります。</p></section>',
