        "vaeua-gui-eua.linearTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph"><span class\\="xis-windowItem">目盛値の表示</span>オプションは、X軸の目盛値を調整するために使用する方法を示します。<span class\\="xis-windowItem">重複を自動で削減</span>または<span class\\="xis-windowItem">固定された向き</span>のいずれかを選択できます。</p><div class\\="xis-paragraph"><span class\\="xis-windowItem">重複を自動で削減</span>オプションは、目盛値が重なり合っている場合にのみ適用されます。次を指定できます。 <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">いくつかをドロップ</span></td><td>一部の目盛値を削除します。</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">45 度回転</span></td><td>すべての目盛値を斜めに45度回転します。</td></tr></table></div>                 </div><div class\\="xis-paragraph"><span class\\="xis-windowItem">固定された向き</span>オプションは常に適用され、値の向きを設定します。次を指定できます。 <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">横</span></td><td>目盛値を横に表示します。</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">45 度回転</span></td><td>すべての目盛値を斜めに45度回転します。</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">45 度回転、ドロップ</span></td><td>すべての目盛値を斜めに45度回転し、目盛値を削除します。</td></tr></table></div>                 </div></section>',
        "vaeua-gui-eua.dataElementStyleRotation.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.interactionEffect.complete.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.linearRegression.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">モデルを拡張して欠損値のあるオブザベーションを含めます。連続効果に観測された平均値が挿入され、欠損値があることを示すインジケーター変数が作成されます。分類効果は欠損値を個別のレベルとして扱います。 </p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.validateError.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.bayesNet.markovBlanket.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.ManageSectionTemplates.saveDialog.localImageSize.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">サムネイルの推奨サイズは、288 x 160ピクセルです。</p></section>',
        "vaeua-gui-eua.sas.van.interactionEffect.twoWay.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.predictorBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">メジャー予測子のビン数を指定します。</p></section>',
        "vaeua-gui-eua.Properties.recommendationsPlot.predictor.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">カテゴリ変数ごとに、最も推奨されるカテゴリまたは最も推奨されないカテゴリを表示します。予測子を選択する前に、少なくとも1つの予測子を割り当てる必要があります。</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.standardizationMethodlabel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">メジャー予測子の標準化に使用される方法を指定します。</p></section>',
        "vaeua-gui-eua.Properties.svm.maxSupportVectors.help.tip.txt": "このオプションの詳細情報 ",
