        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.scatterplot.overviewAxisCannotBeShown.multipleMeasurePairs.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.react.sas.van.views.layout.panels.Properties.geo.cluster.color.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.va.displayRule.alertsDisabled.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.predAuto.showSubgroups.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.partialdependence.numObs.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.leafSize.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.bayesNet.naive.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.splittingCriterion.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.nClusters.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">作成するクラスターの数を指定するか、ABC (aligned box criterion)手法を使用して最適なクラスター数を取得するかを指定します。</p><p class\\="xis-paragraph">ABC手法は、最初に作成するクラスターの数を選択し、クラスターを作成して、各クラスターのギャップ統計量を計算します。次に、各クラスターを中心とした参照分布が作成され、各参照分布のギャップ統計量が計算されます。このプロセスは、すべての潜在的な数のクラスターに対して繰り返されます。クラスターと参照データのギャップ統計量の差異合計を最大化するクラスターの数が、クラスターの最適な数として選択されます。</p><p class\\="xis-paragraph">ABC手法は、すべての入力がメジャー変数である場合にのみ有効です。</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomCategoryEntries.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communityResolution.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.neuralnetwork.l1.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.usedefaultvariable.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">分割ごとの試行に、デフォルトの予測子の数が使用されます。デフォルトは、予測子の総数の平方根です。選択しない場合は、分割ごとに試行する予測子の数を指定します。</p></section>',
        "vaeua-gui-eua.Properties.partialdependence.numBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">部分従属プロットでメジャー変数を分類するために使用するビンの数を指定します。</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.rapidGrowth.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">高速k-meanクラスタリングアルゴリズムを有効化し、ビン順序を無視します。貪欲検索アルゴリズムを使用し、ビン順序を優先する場合には、このオプションは選択しません。ビン分割なしのメジャー応答は、選択基準として分散を使用します。このオプションが選択された場合、カテゴリ応答およびビン分割メジャー応答では、ゲイン率基準が使用されます。それ以外の場合は、絶対ゲインが使用されます。</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.includePartsOfSpeech.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.linearRegression.significanceLevel.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.svm.defaulttolerance.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.barSpacing.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.control.initialValueSVS.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.bayesNet.naive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ナイーブベイジアンネットワークとベイジアンネットワークで拡張されたナイーブベイジアンネットワークの作成を試行します。ナイーブベイジアンネットワークは、応答変数がすべての予測変数の唯一の親であることを指定します。これは、応答変数が与えられる場合に、すべての予測変数の条件付き独立性を仮定します。ベイジアンネットワークで拡張されたナイーブベイジアンネットワークは、予測子ノードによるベイジアンネットワークの形成を許可することによって、ナイーブネットワークを拡張します。</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.rapidGrowth.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
