        "vaeua-gui-eua.sas.van.ReportReview.HighCalculationCount.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communityResolution.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">計算するコミュニティ(ローカルノードグループ)の相対数を指定します。ネットワークが変更されると、コミュニティは動的に更新されます。</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.factMac.nonnegativeFactorization.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">バイアス項がゼロに設定された非負数因子を強制します。これにより、学習データが非常に少ない場合のパフォーマンスが向上する可能性があります。</p></section>',
