        "vaeua-gui-eua.sas.van.Options.capabilityLevel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ユーザーが自分のレポートのビューに行えるカスタマイズのレベルを指定します。レベルには、その下のレベルが含まれます。</p></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.embeddableLink.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">HTMLカスタムタグが生成され、オブジェクトまたはレポートをWebページに埋め込むことができます。</p><p class\\="xis-paragraph">Webページでカスタムタグを有効にするには、ページヘッドに&lt;script&gt;タグを追加することも必要です。SAS Visual Analyticsコンテンツの埋め込みの詳細については、<a href\\="https\\://developer.sas.com/sdk/va/docs/getting-started/" target\\="_blank" rel\\="noopener noreferrer">SAS Visual Analytics SDKドキュメント</a>を参照してください。</p></section>',
        "vaeua-gui-eua.clusterSpacing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph"><span class\\="xis-windowItem">クラスタースペース</span>オプションは、グループ化された棒のクラスター間のスペースの幅を制御します。棒間のスペースを変更する場合は、<span class\\="xis-windowItem">スペーシング</span>オプションを指定します。</p></section>',
        "vaeua-gui-eua.AutoCustomCategoryPanel.categoryType.help.content.txt.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph"><span class\\="xis-windowItem">一意の値</span>グループの種類は、重複しない値の数が少ないメジャーでのみ使用できます。</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.responseBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">メジャー応答の分類に使用されるビン数を指定します。</p></section>',
