        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruneWithValidationData.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">学習データを使用してディシジョンツリーを成長させ、検証データに適用されるコスト複雑性アルゴリズムを使用してディシジョンツリーを剪定します。</p></section>',
