        "vaeua-gui-eua.Properties.generalizedAdditive.modelEvaluationCriterion.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">スプライン効果の平滑化パラメーターを選択するための基準を指定します。</p></section>',
        "vaeua-gui-eua.Properties.assessment.useDefaultNumberOfBins.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.bayesNet.chooseBestNumParents.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">1から最大親数の値までの親の数に対して、指定されたネットワーク構造の作成を繰り返します。最良の誤分類率を有するネットワークが選択されます。</p></section>',
        "vaeua-gui-eua.react.va.geo.search.pinLocation.help.tip.txt": "このオプションの詳細情報 ",
