        "vaeua-gui-eua.Properties.predAuto.sensitivityToExtremeValues.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">極値を識別するために使用される鋭敏比を指定します。感度設定を高くすると、通常、より多くの値が極端として識別されます。</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.treeAugmentedNaive.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
