        "vaeua-gui-eua.sas.van.ShareDialog.useGuestAccess.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ユーザーがログイン画面をスキップし、ゲストの資格情報を自動的に使用するように指定します。ユーザーがゲストの資格情報を使用している場合、ビューの状態はセッション間で保持されず、ユーザープリファレンスは使用できません。</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.maxLevels.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ツリーの最大の深さを指定します。この場合、ルートノードは水準1です。</p></section>',
        "vaeua-gui-eua.Properties.linearRegression.variableSelection.maximumEffects.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
