        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.learning_rate.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">学習率を指定します。緩慢な学習は、モデルのオーバーフィットを防ぎます。</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.allowNeuronDirectConnect.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.svm.sigmoidParameterTwo.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.usedefaultvariable.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.control.initialMaxValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">コントロールの初期最大値(上限)を指定します。初期値は、ユーザーが初めてレポートを開いたとき、またはユーザーが<span class\\="xis-windowItem">デフォルトのレポート状態を復元</span>を選択したときに選択されます。 </p><div class\\="xis-paragraph">テキストフィールドに値を入力するか、次のいずれかを指定します。 <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">自動</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">レポートを保存するときに、選択内容が初期値として保存されることを指定します。 </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">最大値</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">コントロールの最大値が初期値であることを指定します。</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">parameter-name</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">選択したパラメーターの値がコントロールの初期値であることを指定します。</p><p class\\="xis-paraSimple">適切なデータの種類のパラメーターがすでに存在する場合にのみ、パラメーターを選択できます。</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.react.va.geo.search.includeTraffic.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">グラフィック機能の移動時間を計算するためにトラフィックを使用する方法を指定します。次のいずれかのオプションを選択します。 <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">いいえ</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">移動時間の計算で、すべての時間帯とすべての曜日におけるトラフィックの履歴データを、重み付き平均で使用することを指定します。</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">現在のトラフィック</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">移動時間の計算で、現在のトラフィック状況を使用することを指定します。<span data-icon-name\\="refresh" alt\\="トラフィックデータの更新アイコン" aria-label\\="トラフィックデータの更新アイコン"></span>をクリックすると、トラフィックデータを更新できます。ユーザーがレポートを表示しても、トラフィックは自動的に更新されません。最新のトラフィック状況を反映するために、ユーザーはトラフィックデータを更新する必要があります。</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">典型的なトラフィック</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> 移動時間の計算で、指定された時間と曜日の典型的なトラフィックを使用することを指定します。典型的なトラフィック状況は、最近の履歴データに基づいています。</p><div class\\="xis-note"><span class\\="xis-noteGenText">注\\:</span> 指定した時間は、マップ上の場所のローカル時間です。</div></dd></dl></div>                 </div><div class\\="xis-note"><span class\\="xis-noteGenText">注\\:</span>移動時間データを取得すると、Esriプレミアムサービスクレジットが消費されます。</div><div class\\="xis-note"><span class\\="xis-noteGenText">注\\:</span>移動時間の計算を含む領域のトラフィックデータが利用できない場合は、公示された制限速度を使用して移動時間が計算されます。</div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.extractNounGroups.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
