        "vaeua-gui-eua.sas.van.splineEffect.twoWay.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">選択されたアイテムの各ペアから構成される効果。この効果には、少なくとも2つのアイテムが必要です。</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.SplitNodePanel.logWorth.definition.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ノードの分割に使用する変数を選択します。変数は、変数によるデータの分割の価値を測定する対数価値に基づいて並べ替えられます。対数価値は、カイ2乗検定からのp値の負の対数です。</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.scatterplot.overviewAxisCannotBeShown.multipleMeasurePairs.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">軸の概要を表示します。</p><p class\\="xis-paragraph">このオプションは、3つ以上のデータアイテムがプロットに割り当てられている場合は使用できません。</p></section>',
