        "vaeua-gui-eua.Properties.svm.defaultiteration.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">モデルの当てはめプロセスが停止する、デフォルトの最大反復回数が使用されます。デフォルトは、25です。</p></section>',
        "vaeua-gui-eua.Properties.svm.defaulttolerance.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">反復が停止する、デフォルトの最小絶対許容値が使用されます。デフォルトは、1.0E-6です。</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighPageHeaderObjectCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ページプロンプトエリアからコントロールを削除して、次の問題を解消します。たとえば、優先度(中)の問題を解消するには、ページプロンプトエリアのコントロール数を10個以下に減らします。</p><p class\\="xis-paragraph">優先度(中)\\: ページプロンプトエリアに10個より多い(&gt; 10)オブジェクトが含まれている。</p></section>',
        "vaeua-gui-eua.va.displayRule.alertsDisabled.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
