        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.geo.cluster.color.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">クラスターのデータ値に基づいてクラスターに色を付けます。このオプションは、<span class\\="xis-windowItem">色</span>データ役割が割り当てられている場合にのみ使用できます。</p></section>',
