        "vaeua-gui-eua.Properties.neuralnetwork.l2.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">L2正則化パラメーターを指定します。非ゼロ値は最も有意な予測子の識別をサポートします。</p></section>',
