        "vaeua-gui-eua.sas.van.ReportReview.HighCalculationCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">計算数を減らして、次の問題を解消します。たとえば、優先度(低)の問題を解消するには、レポートの計算数を14個以下に減らします。</p><p class\\="xis-paragraph">優先度(低)\\: 15個以上(&gt;\\=15)の計算を含む</p></section>',
