        "vaeua-gui-eua.Properties.generalizedAdditive.maxDf2d.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">すべての2次元スプライン効果の自由度の最大数を指定します。</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.variableSelection.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">指定された独立性検定統計量では、他の予測子が与えられる場合に、各予測子を応答変数の条件付き独立について検定します。<span class\\="xis-windowItem">変数選択</span>を選択すると、他の予測子が与えられる場合に、応答変数に独立する予測子を拒否します。</p></section>',
        "vaeua-gui-eua.react.va.geo.search.includeTraffic.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
