        "vaeua-gui-eua.Properties.assessment.cutoff.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">オブザベーションがモデル化されたイベントかを決定する予測確率カットオフを指定します。</p></section>',
        "vaeua-gui-eua.sas.van.pageVisibility.hideLinks.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.sas.van.ReportReview.NestedContainers.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">レポートレイアウトを調整して、ネストコンテナーを回避し、次の問題を解消します。たとえば、優先度(高)の問題を解決するには、レポートレイアウトのネストコンテナーが6個以下である必要があります。</p><p class\\="xis-paragraph">優先度(低)\\: 2個より多い(&gt; 2)ネストコンテナーが含まれている</p><p class\\="xis-paragraph">優先度(中)\\: 4個より多い(&gt; 4)ネストコンテナーが含まれている</p><p class\\="xis-paragraph">優先度(高)\\: 6個より多い(&gt; 6)ネストコンテナーが含まれている</p></section>',
