        "vaeua-gui-eua.Properties.neuralnetwork.validateError.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">モデル学習を完了するために受け入れ可能な最大検証誤差を指定します。検証誤差が指定したゴール値未満であると、モデル学習を終了します。</p></section>',
