        "vaeua-gui-eua.discreteTickValueFitPolicy.help.tip.txt": "このオプションの詳細情報 ",
        "vaeua-gui-eua.Distribution.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">応答変数のモデル化に使用される分布関数を指定します。</p></section>',
        "vaeua-gui-eua.dataElementStyleRotation.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph"><span class\\="xis-windowItem">データ要素スタイルローテーション</span>オプションは、グラフテンプレートのデータ要素にスタイルを割り当てる方法を指定します。たとえば、折れ線グラフでは、このオプションは、色、線の種類、マーカーを使用してグラフの線を区別する方法を指定します。 <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">自動</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">テーマのスタイルローテーション設定を使用します。大部分のSASテーマでは、<span class\\="xis-windowItem">すべての色を最初にローテーション</span>設定が使用されます。ハイコントラストテーマでは、<span class\\="xis-windowItem">すべての属性をローテーション</span>設定が使用されます。</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">すべての色を最初にローテーション</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">パレットのすべての色が使用されない限り、単色の塗りつぶし、単色の線、および一貫したマーカーの形を表示します。</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">すべての属性をローテーション</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">色を変えるだけではなく、複数の塗りつぶしの種類、線の種類、マーカーの形を表示します。この設定により、色覚多様性ユーザーのアクセシビリティを向上させることができます。</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.useGuestAccess.help.aria.txt": "ヘルプ. このオプションの詳細情報 ",
        "vaeua-gui-eua.Properties.svm.sigmoidParameterOne.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">シグモイド関数のスケール(係数)パラメーターを指定します。</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communities.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ノードの各クラスターで計算するコミュニティ(ローカルノードグループ)の数を指定します。計算されたコミュニティの総数は、ネットワークの構造とサイズに応じて、選択した値よりも小さくなる可能性があることに注意してください。</p></section>',
