        "vaeua-gui-eua.glm.linkFunction.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">一般化線形モデルと応答の分布との関係付けに使用するリンク関数を指定します。                 </p></section>',
        "vaeua-gui-eua.barLabelFitPolicy.help.tip.txt": "このオプションの詳細情報 ",
